	,setProgressBar: function(timerAmount,gameLength) {
		var diff = 0;
		if(timerAmount < 0) {
			diff = timerAmount * -1;
		} else {
			diff = timerAmount;
		}
		var perc = diff / gameLength * 100;
		var xAmount = this.centerPoint * perc / 100;
		if(timerAmount < 0) {
			if(perc >= 100) {
				this.progressBar.set_width(this.barFullWidth);
				this.progressSys.set_emitterX(this.progressBar.get_x() + this.progressBar.get_width());
				this.nextLevel();
			} else {
				this.progressBar.set_width(this.centerPoint + xAmount);
				this.progressSys.set_emitterX(this.progressBar.get_x() + this.progressBar.get_width());
			}
		} else if(perc >= 100) {
			this.progressBar.set_width(0);
			this.showEnd();
		} else {
			this.progressBar.set_width(this.centerPoint - xAmount);
			this.progressSys.set_emitterX(this.progressBar.get_x() + this.progressBar.get_width());
		}
	}
