		this.sprGrid.set_x(this.scroll.get_x() + (this.scroll.get_width() / 2 - this.sprGrid.get_width() / 2));
		this.sprGrid.set_y(this.scroll.get_y() + (this.scroll.get_height() / 2 - this.sprGrid.get_height() / 2));
		this.addChild(this.sprGrid);
