	,onFireTouch: function(e) {
		var touchtest = e.getTouch(this.menuHolder);
		if(e.getTouches(this.sliderBtn,"moved").get_length() > 0) {
			var xpos = touchtest.getLocation(this.menuHolder).x;
			if(this.sliderLeftX <= xpos && this.sliderRightX >= xpos) {
				this.sliderBtn.set_x(xpos);
				var val = this.sliderLength - (this.sliderRightX - this.sliderBtn.get_x());
				var sliderVal = val * 100 / this.sliderLength | 0;
				var perc;
				if(sliderVal > 0 && sliderVal <= 10) {
					this.difficultyLevel = 1;
					this.sliderCharacter.set_currentFrame(0);
				} else if(sliderVal > 10 && sliderVal <= 20) {
					this.difficultyLevel = 2;
					this.sliderCharacter.set_currentFrame(1);
				} else if(sliderVal > 20 && sliderVal <= 30) {
					this.difficultyLevel = 3;
					this.sliderCharacter.set_currentFrame(2);
				} else if(sliderVal > 30 && sliderVal <= 40) {
					this.difficultyLevel = 4;
					this.sliderCharacter.set_currentFrame(3);
				} else if(sliderVal > 40 && sliderVal <= 50) {
					this.difficultyLevel = 5;
					this.sliderCharacter.set_currentFrame(4);
				} else if(sliderVal > 50 && sliderVal <= 60) {
					this.difficultyLevel = 6;
					this.sliderCharacter.set_currentFrame(5);
				} else if(sliderVal > 60 && sliderVal <= 70) {
					this.difficultyLevel = 7;
					this.sliderCharacter.set_currentFrame(6);
				} else if(sliderVal > 70 && sliderVal <= 80) {
					this.difficultyLevel = 8;
					this.sliderCharacter.set_currentFrame(7);
				} else if(sliderVal > 80 && sliderVal <= 90) {
					this.difficultyLevel = 9;
					this.sliderCharacter.set_currentFrame(8);
				} else if(sliderVal > 90 && sliderVal <= 100) {
					this.difficultyLevel = 10;
					this.sliderCharacter.set_currentFrame(9);
				}
			}
			touchtest = null;
			this.txtTopScore.set_text("Level " + this.difficultyLevel + " Best: " + com_glasirgames_thword_filemanagement_HighScores.getInstance().getRampageScore(this.letterCountSelected,this.difficultyLevel));
			this.setScore();
		}
	}
	,onStartTriggered: function(e) {
		com_glasirgames_thword_model_GameSettingsVO.getInstance().letterCount = this.letterCountSelected;
		com_glasirgames_thword_model_GameSettingsVO.getInstance().difficultyLevel = this.difficultyLevel;
		com_glasirgames_thword_model_GameSettingsVO.getInstance().gameType = this.gameSelected;
		if(this.gameSelected == "gameendurance") {
			com_glasirgames_thword_model_EnduranceVO.getInstance().letterCount = this.letterCountSelected;
			com_glasirgames_thword_model_EnduranceVO.getInstance().selectedLevel = this.difficultyLevel;
		} else {
			com_glasirgames_thword_model_RampageVO.getInstance().letterCount = this.letterCountSelected;
			com_glasirgames_thword_model_RampageVO.getInstance().selectedLevel = this.difficultyLevel;
		}
		this.startGame.dispatch();
	}
