	,buildVerticalScrollbar: function() {
		var barWidth = 20;
		if(this._width * 0.1 < 20) {
			barWidth = this._width * 0.1;
		}
		this.sliderBar = new starling_display_Quad(barWidth,this._height,6697728);
		this.sliderBar.set_x(this._width - this.sliderBar.get_width());
		this.sliderBar.set_y(0);
		this.addChild(this.sliderBar);
		var btnHeight = 10;
		var difference = 0;
		if(this._sprList.get_height() > this._height) {
			btnHeight = this._height * (this._height / this._sprList.get_height()) | 0;
		} else {
			btnHeight = 10;
		}
		var rt = new starling_textures_RenderTexture(barWidth | 0,btnHeight);
		rt.draw(new starling_display_Quad(barWidth - 3,btnHeight,16777215));
		this.sliderBtn = new starling_display_Button(rt);
		this.addChild(this.sliderBtn);
		this.sliderBtn.set_x(this.sliderBar.get_x() + 2);
		this.sliderBtn.set_y(this.sliderBar.get_y() + 1);
		this.sliderBtn.set_scaleWhenDown(1);
		this.sliderBtn.addEventListener("touch",$bind(this,this.onSliderTouch));
		this.minY = this.sliderBtn.get_y();
		this.maxY = this._height;
		this.slideStart = this.sliderBtn.get_y() + btnHeight;
	}
	,onSliderTouch: function(e) {
		var touch = e.getTouch(this);
		if(e.getTouches(this.sliderBtn,"moved").get_length() > 0) {
			var touchPos = touch.getLocation(this).y;
			if(this.prevY != 0) {
				if(touchPos > this.prevY) {
					this.moveAmount = touchPos - this.prevY;
					if(this.maxY >= this.sliderBtn.get_y() + this.sliderBtn.get_height() + this.moveAmount) {
						var _g = this.sliderBtn;
						_g.set_y(_g.get_y() + this.moveAmount);
						this.slidePercentage = 100 * (this.sliderBtn.get_y() + this.sliderBtn.get_height() - this.slideStart) / (this.maxY - this.slideStart);
						this._sprList.set_y(0 - (this._sprList.get_height() - this._height) * this.slidePercentage / 100);
					}
				} else {
					this.moveAmount = this.prevY - touchPos;
					if(this.minY <= this.sliderBtn.get_y() - this.moveAmount) {
						var _g = this.sliderBtn;
						_g.set_y(_g.get_y() - this.moveAmount);
						this.slidePercentage = 100 * (this.sliderBtn.get_y() + this.sliderBtn.get_height() - this.slideStart) / (this.maxY - this.slideStart);
						this._sprList.set_y(0 - (this._sprList.get_height() - this._height) * this.slidePercentage / 100);
					}
				}
			}
			this.prevY = touchPos;
		}
		if(touch != null && touch.get_phase() == "ended") {
			this.prevY = 0;
		}
		touch = null;
	}
